    render() {
        logo=require("../images/chadopt-text-white.png")
        return (
        <header>
            <img src="/static/media/chadopt-text-white.a2b9feaf59ae1313a29d.png"/>
      <nav>
          <ul>
              <li>Accueil</li>
              <li>Tendances</li>
              <li>Admin</li>
              </ul>
              </nav>
              </header>
        );
    }
}

export default Header;
